import React from 'react';
import { createStackNavigator } from "@react-navigation/stack";
import { Ionicons } from '@expo/vector-icons';
import { TouchableOpacity } from 'react-native-gesture-handler';
import {HomeScreen, SearchScreen} from '../ScreemFolder/OtherScreen';
import {ProfileScreen} from '../ScreemFolder/UserScreen';
import {
  ReadingScreen, 
  DetailStoryScreen,
} from '../ScreemFolder/StoryScreen'
import { CategoryDetail } from '../Components/CategoryComponent';

const HomeStack = createStackNavigator();
const HomeStackScreen = (props) => (
<HomeStack.Navigator mode="modal">
    <HomeStack.Screen 
      name="Home" 
      component={HomeScreen}
      options = {{
        title: 'Home',
        headerTitleAlign: 'center',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerShown: false,
        headrTintColor: '#fff',
       }}
    />  
    <HomeStack.Screen 
      name="DetailStory" 
      options = {{
        title: 'Detail story',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff'
       }}
      component={DetailStoryScreen}
    />
    <HomeStack.Screen 
      name="Reading" 
      label= 'Reading' 
      component={ReadingScreen} 
      options={{
        headerShown: false,
        tabBarVisible: false,
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
        headerRight: ()=> (
          <TouchableOpacity>
            <Ionicons name="md-menu" size={40} color="white" style={{marginRight: 20}}/>
          </TouchableOpacity>
        )
      }}
    />
    <HomeStack.Screen name="result" component={SearchScreen} 
      options = {{
        title: 'Result search',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }} 
    />
    <HomeStack.Screen 
      name="DetailCategory" 
      options = {{
        title: 'Category story',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }} 
      component={CategoryDetail}/>
    <HomeStack.Screen 
      name="DetailUser" 
      options = {{
        title: '',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }}  
      component={ProfileScreen} 
    />
  </HomeStack.Navigator>
)
export {HomeStackScreen};
